import './App.css';
import { useEffect } from 'react';

function App() {
  useEffect(()=> {
     fetch("http://localhost:8082/api/v1/employees")
     .then((response) => response.json)
     .then((employeeItem)=> {
      console.log("employee : " +employeeItem);
     });
  });
  return (
    <div className="App">
      hello moi nguoi mionh la sinh di code dao
    </div>
  );
}

export default App;
